[[File:Ali the Kebab seller chathead.png|left]]
'''Ali the Kebab seller''' is a man who runs his [[kebab]] business in the town centre of [[Pollnivneach]]. He sells [[kebab]]s for three [[coins]] each, [[super kebab]]s for five coins each, and gives [[red hot sauce]] for free if the player asks for it, if the player doesn't have it in their bank or inventory. The [[drop trick]] will work to get more than one bottle.

==Treasure Trails==
{{Cipher|Ali the Kebab seller|medium|BMJ UIF LFCBC TFMMFS}}. He will present the player with a [[challenge scroll]] asking, ''"How many coins would you need to purchase 133 kebabs from me?"'', the answer to which is 399.

